  casts aboard NAVIGATION RESPONSE TEAM 5 as part of project OPR-B301-NRT5-11 in the
  North Atlantic Ocean from 2011-06-23 to 2011-09-19 (NCEI Accession 0130288)\",\n\t\"tracking_summary\":
