  [],\n\t\"revision_timestamp\": \"2015-09-26T20:24:53.010358\",\n\t\"name\": \"oceanographic-profile-data-collected-from-ctd-casts-aboard-navigation-response-team-5-as-part-o\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130288 includes physical
  and profile data collected aboard the NAVIGATION RESPONSE TEAM 5 during project
  OPR-B301-NRT5-11 in the North Atlantic Ocean from 2011-06-23 to 2011-09-19. These
  data include CONDUCTIVITY, HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY, WATER
  DENSITY and WATER TEMPERATURE. The instruments used to collect these data include
  CTD. These data were collected and submitted by the NOAA Office of Coast Survey
  in support of hydrographic multibeam surveys to meet NOAA charting requirements.\",\n\t\"license_title\":
